import Header from "../components/Header";
import Footer from "../components/Footer";
import '../styles/home.css';
// import homeImg from '../assets/home-contactUs-edit.png';

function Home() {
    return (
        <div className="App">
                <Header/>
            <div className='Full-block'>
                <div className='First-block'>
                    {/*<Image src={homeImg} className='homeImg'/>*/}
                    <p className='First-block-title Display-1'>
                        Піклуємося про вас та сім'ю
                    </p>
                    <p className='First-block-body Display-2'>
                        Від загальної практики до спеціалізованих консультацій - ми тут для вас
                    </p>
                </div>
            </div>
                <Footer/>
        </div>
    );
}
export default Home;
